script: |
  super -f text -I q7339.spq | sort > q7339.out

inputs:
  - name: q7339.spq
    data: |
      SELECT ALL - col2 + + col2 col0 FROM tab2 (FORMAT parquet) WHERE + col1 * - 84 - - col1 * - ( col2 ) + + 33 * - + 82 NOT IN ( 9 + + CAST ( col2 AS INTEGER ) * + - col0, col1 );
  - name: tab2

outputs:
  - name: q7339.out
    data: |
      0
      0
      0
